import Vue from 'vue'
import App from './App.vue'
import store from "./store/index";
import { Container,  } from 'element-ui';

Vue.config.productionTip = false
Vue.use(Button)
Vue.use(Select)

new Vue({
  render: h => h(App),
  store
}).$mount('#app')
